import {Header} from './components/header';
import {Footer} from './components/footer';

const App = () => {

  let name = "Demetrio"
  let age = 23;


  const handleClick = () => {
    alert("Clicou na função.")
  }

  return (
    <div>
      <Header name={name} age={age}/>

      <button onClick={handleClick}>Clique aqui</button>

      <Footer/>
    </div>
  )
}


export default App;
